const { _, log, runSamples, ...aoc } = require('./dist/util')

function reacts(a, b) {
    return (a.toLowerCase() === b || a === b.toLowerCase()) && a !== b
}

function fullyReact(pol) {
    let i = 0
    while (i+1 < pol.length) {
        if (reacts(pol[i], pol[i+1])) {
            pol.splice(i, 2)
            i = Math.max(i-1, 0)
        } else {
            i += 1
        }
    }
}

/** @param {string[]} lines */
function main(lines) {
    let pol = Array.from(lines[0])

    const units = _.uniq(_.uniq(pol).map(x => x.toLowerCase()))
    let track = []
    for (let u of units) {
        newPol = pol.filter(v => v.toLowerCase() !== u)
        fullyReact(newPol)
        track.push([u, newPol.length])
    }

    log(_(track).sortBy(d => -d[1]).value())
}

